import React from 'react'

const SlideRecipes = ({someRecipes}) => {
  console.log(someRecipes)
  return (
    <div>
       {someRecipes.map((someRecipe) => (
         <>
         <p>{someRecipe.title}</p>
         <img src={someRecipe.image} alt="" />
         </>
       ))}
    </div>
  )
}

export default SlideRecipes
